import React, { useEffect, useState } from "react";
import Base from "../../components/Base";
import { getCurrentUserDetail } from "../../auth";
import { useParams } from "react-router-dom";
import { getUserDetails } from "../../services/user-service";
import { Card, CardBody, CardHeader, Col, Container, ListGroup, ListGroupItem, Row } from "reactstrap";

const ProfileInfo = () => {
  let object = getCurrentUserDetail();
  console.log(object);

  const { id } = useParams();
  console.log(id);

  const [user, setUser] =  useState(null);

  useEffect(() => {
    getUserDetails(id)
      .then((data) => {
        console.log(data);
        setUser({ ...data });
      })
      .catch((error) => {
        console.log(error);
      });
  },[]);

  return (
    <Base>
    <Container>
      <Row>
        <Col>
          <Card>
            <CardHeader>
              User Details
            </CardHeader>
            <CardBody>
              <ListGroup>
                <ListGroupItem>
                  Name : {user.name}
                </ListGroupItem>
              </ListGroup>
            </CardBody>
          </Card>
        </Col>
      </Row>
    </Container>
    </Base>
  );
};

export default ProfileInfo;
